import * as helaperApi from "../Api/helperApis.js";

export const addTeamToAlliance = async (team, alliance, teams, alliances) => {
  try {
    const alliancesUpdated = await helaperApi.addTeamToAllianceApi(
      team,
      alliance
    );

    return alliancesUpdated;
  } catch (err) {
    console.log(err);
  }
};

export const updateAlliance = async (team, alliance, teams, alliances) => {
  try {
    const allianceUpdated = await helaperApi.updateAlliance(team, alliance);

    return allianceUpdated;
  } catch (err) {
    console.log(err);
  }
};
